                VariabiliGlobali.Globals.myMaps.iMap[i, j] = this.L1_iMap[i, j];
                VariabiliGlobali.Globals.myMaps.iMapTrans[i, j] = this.L1_iMapTrans[i, j];
                VariabiliGlobali.Globals.myMaps.iMapObjects[i, j] = this.L1_iMapObjects[i, j];
                VariabiliGlobali.Globals.myMaps.iMapTrans2[i, j] = this.L1_iMapTrans2[i, j];
                VariabiliGlobali.Globals.myMaps.cMapWalkable[i, j] = this.L1_cMapWalkable[i, j];
            }
        }

        // Numero dei mostri contenuti nella mappa
        iNumeroMostriNellaMappa = 3;

        //Coordinate del Mostro1
        VariabiliGlobali.Globals.myMonster[0].MlaRun_.bSelezionato = true;
        VariabiliGlobali.Globals.myMonster[0].iPlayerAvatarX = 38;
        VariabiliGlobali.Globals.myMonster[0].iPlayerAvatarY = 0;

        //Coordinate del Mostro2
        VariabiliGlobali.Globals.myMonster[1].MlaRun_.bSelezionato = true;
        VariabiliGlobali.Globals.myMonster[1].iPlayerAvatarX = 14;
        VariabiliGlobali.Globals.myMonster[1].iPlayerAvatarY = 11;

        //Coordinate del Mostro3
        VariabiliGlobali.Globals.myMonster[2].MlaRun_.bSelezionato = true;
        VariabiliGlobali.Globals.myMonster[2].iPlayerAvatarX = 56;
        VariabiliGlobali.Globals.myMonster[2].iPlayerAvatarY = 12;

        //Coordinate del Personaggio
        VariabiliGlobali.Globals.myMaps.iMapX = 2;
        VariabiliGlobali.Globals.myMaps.iMapY = 17;

    }

