                VariabiliGlobali.Globals.myMaps.cMapWalkable[i, j] = this.L8_cMapWalkable[i, j];
            }
        }

        // Numero dei mostri contenuti nella mappa
        iNumeroMostriNellaMappa = 4;

        //Coordinate del Mostro1
        VariabiliGlobali.Globals.myMonster[0].CybeRun_.bSelezionato = true;
        VariabiliGlobali.Globals.myMonster[0].iPlayerAvatarX = 37;
        VariabiliGlobali.Globals.myMonster[0].iPlayerAvatarY = 7;

        //Coordinate del Mostro2
        VariabiliGlobali.Globals.myMonster[1].TrollRun_.bSelezionato = true;
        VariabiliGlobali.Globals.myMonster[1].iPlayerAvatarX = 62;
        VariabiliGlobali.Globals.myMonster[1].iPlayerAvatarY = 10;

        //Coordinate del Mostro3
        VariabiliGlobali.Globals.myMonster[2].MlaRun_.bSelezionato = true;
