        VariabiliGlobali.Globals.myMonster[3].iPlayerAvatarX = 11;
        VariabiliGlobali.Globals.myMonster[3].iPlayerAvatarY = 16;

        //Coordinate del Personaggio
        VariabiliGlobali.Globals.myMaps.iMapX = 1;
        VariabiliGlobali.Globals.myMaps.iMapY = 19;

